import {BrowserRouter, Switch, Route} from "react-router-dom";
import './App.css';
import MenuButton from './components/buttonmenu/buttonmenu';
import NavBar from './components/navbar/navbar';


function App() {
  return (
    <BrowserRouter>
      <NavBar/>
      <Switch>
        <Route path="/home">
          <div className="App">
            <MenuButton/>
          </div>
        </Route>

      </Switch>


    </BrowserRouter>




  );
}

export default App;
